import React from 'react';
import { useEffect, useState } from 'react';
import logo from './logo.svg';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import './App.css';
import { Bar } from 'react-chartjs-2';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

interface graphInterface {
  id: number,
  velocirt: string
}

function App() {


  const [graph, setGraph] = useState<graphInterface[]>([])

  fetch('http://127.0.0.1:8000/velocity/users')
    .then(response => response.json())
    .then(data => {
      setGraph(data);
    });

  const labels = graph.map(point => point.id)

  const [data, setData] = useState({
    labels: labels,
    datasets: [{
      label: 'Expenses by Month',
      data: [65, 59, 80, 81, 56, 55, 40],
      backgroundColor: [
        'rgb(153, 102, 255)'
      ],
      borderColor: [
        'rgb(153, 102, 255)'
      ],
      borderWidth: 1
    }]
  });

  return (
    <div className="App">
      <header className="App-header">
        <Bar data={data} />
      </header>
    </div>
  );
}

export default App;
